import styled from "styled-components";

export const StyledNav = styled.div`
  /* background-color: ${({ theme }) => theme.colors.div}; */
  color: #fefefe;
  display: flex;
  justify-content: center;

  p {
    font-size: 1.3em;
  }

  img {
    height: 1.3em;
    width: 100%;
  }
`;
